import React, { Component } from "react";
import TweetEmbed from "react-tweet-embed";
class Tweet extends Component {
  render() {
    return (
      <div className="tweet">
        <h2>Tweets</h2>
        <iframe
          title="Event Ray"
          width="400"
          height="290"
          src="//www.youtube.com/embed/Q8TXgCzxEnw?rel=0"
          frameborder="0"
          allowfullscreen
        ></iframe>
      </div>
    );
  }
}

export default Tweet;
